import "./config"
import React from 'react';
import ReactDOM from 'react-dom';
import './styles/index.css';
import App from './App';
import {AuthCluster} from './clusters/auth-cluster';

ReactDOM.render(
  <React.StrictMode>
    <App />
    <AuthCluster />
  </React.StrictMode>,
  document.getElementById('root')
);
